import React, { useState } from 'react';
import { toast } from 'react-toastify';
import { useNavigate } from 'react-router-dom';
import { useDispatch } from 'react-redux';
import { Link } from 'react-router-dom';

import './index.css';

import delivery from '../../Assets/delivery-boy-02.avif';
import restaurant from '../../Assets/restaurant.avif'
import { getRestaurantsByZip } from '../../Functions/Auth';


const Home = () => {
    const navigate = useNavigate();
    const dispatch = useDispatch();
    const [zipCode, setZipCode] = useState('');

    const handleSearch = () => {
        getRestaurantsByZip(zipCode)
            .then(res => {
                if (res.status === 200) {
                    dis
                    navigate(`/zip/${zipCode}`);
                    toast.success(res.message);
                } else {
                    toast.error(res.message)
                }
            })
            .catch(error => toast.error(error))
    }

    return (
        <div className='home'>
            <div className='banner d-flex justify-content-center align-items-center'>
                <div className='input-group banner-text'>
                    <span class='input-group-text' id='basic-addon1'><i class='bi bi-geo-alt-fill'></i></span>
                    <input
                        id='zipCode'
                        type='text'
                        className='form-control'
                        value={zipCode}
                        onChange={(e) => setZipCode(e.target.value)}
                        placeholder='Enter Zip Code'
                    />
                    <span className={`input-group-text ${zipCode?.length === 5 ? 'banner-button' : 'banner-button-disabled'}`} id='basic-addon1' onClick={() => handleSearch()}><i class='bi bi-arrow-right-circle-fill'></i></span>
                </div>
            </div>
            <div className='container-fluid my-5 px-md-5'>
                <div className='row mx-md-2'>
                    <div className='col-lg-8 col-md-12 col-10 offset-lg-2 offset-md-0 offset-1 p-md-4 p-3 text-center shadow'>
                        <div className='row d-flex justify-content-center'>
                            <div className='col-10 col-lg-4 my-3 mx-2 p-0'>
                                <img src={delivery} className='card-img-top' alt='...' />
                                <div className='text-start p-3'>
                                    <h4 className='card-title py-2'>Become a delivery driver</h4>
                                    <p className='card-text'>As a delivery driver, you'll make reliable moneyâ€”working anytime, anywhere.</p>
                                    <Link className='text-decoration-none custom-text-color' to={'/partner-with-us'} ><h6 className='card-text'>Start earning <i class='bi bi-arrow-right'></i></h6></Link>
                                </div>
                            </div>
                            <div className='col-10 col-lg-4 my-3 mx-2 p-0'>
                                <img src={restaurant} className='card-img-top' alt='...' />
                                <div className='text-start p-3'>
                                    <h4 className='card-title py-2'>Become a partner</h4>
                                    <p className='card-text'>Grow your business and reach new customers by partnering with us.</p>
                                    <Link className='text-decoration-none custom-text-color' to={'/partner-with-us'} ><h6 className='card-text'>Sign up your store <i class='bi bi-arrow-right'></i></h6></Link>
                                </div>
                            </div>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    )
}

export default Home;
